/* eslint-disable no-unused-vars */
import React from 'react';


class Card extends React.Component {
    state = {
        imageUrl: "https:/picsum.photos/90",
    };

    styles = {
       width: "18rem"
    };


    render(){ 
        return (
            //react element starts
            //we can add <React.Fragment> instead of <div></div> if we don't want this blank div

            <div className="container">
                <div className="row">

                    <div className="col-md-12 col-12 mt-5">
                        <div className="card">
                            <img style={this.styles} className="card-img-top" src={this.state.imageUrl} alt="Card" />
                            <div className="card-body">
                                <h5 className="card-title">Ilish 2kg</h5>
                                <button className="btn btn-primary">Add to cart</button>
                            </div>
                        </div>
                    </div>

                </div>
            </div>
        ); 
    }
}



export default Card;
